// Parse the OSC messages
let oscMessages = JSON.parse(msg.payload);

// Initialize an array to store the messages
let messages = [];

// Iterate over the OSC messages
for (let i = 0; i < oscMessages.length; i++) {
    // Get the address and args from the OSC message
    let address = oscMessages[i].address;
    let args = oscMessages[i].args;

    // Create a new message with the address as the topic and the first arg as the payload
    let message = { topic: address, payload: Array.isArray(args) ? args[0] : args };

    // Add the message to the array
    messages.push(message);
}

// Return the array of messages
return [messages];

msg.topic = '/' + msg.topic;
msg.payload = Object.values(msg.payload).map(val => ({ type: 'i', value: val }));
return msg;

if (msg.topic.endsWith('init')) {
    if (msg.payload == 1) {
        msg.action = { command: 'start' };
    } else {
        msg.action = { command: 'stop' };
    }
}
return msg;
